import React from 'react';
import alex from '../alex.jpg'


const Card = () => {
    return (
      <div className="flex items-center justify-center h-screen">
        <div className="max-w-sm rounded overflow-hidden shadow-lg">
          <img className="w-full rounded-full" src={alex} alt="Random" />
          <div className="px-6 py-4">
            <div className="font-bold text-xl mb-2">Alessia Gaudioso</div>
            <p className="text-gray-500 text-base">
            Freelance Web Developer<br />
            Freelance Writer
            </p>
          </div>
          <div className="px-6 py-4">
            <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700 mr-2">#tag1</span>
            <span className="inline-block bg-gray-200 rounded-full px-3 py-1 text-sm font-semibold text-gray-700">#tag2</span>
          </div>
        </div>
      </div>
    );
  };
  
  export default Card;
